import React from 'react';
import {
    Card,
    CardImg,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Container,
} from 'reactstrap';

class RecruiterCard extends React.Component {

    constructor(props){
        super(props);

        this.state = {
            modal: false,
        };
    }

    render() {
        console.log(this.props);
        return (
            <div id="recruiter">
                <Card>
                    <CardImg className='img-fluid rounded-circle' style={{width:'40%', margin: '1em'}} src={'http://192.168.56.101:1337' + this.props.Headshot.url} alt='headshots'/>
                    <CardTitle>{this.props.FirstName} {this.props.LastName}</CardTitle>
                    {/* <div id='calendly' dangerouslySetInnerHTML={{__html:this.props.CalendlyAPIURL}} /> */}
                    {/* <!-- Calendly inline widget begin --> */}
                        <div className="calendly-inline-widget" data-url="https://calendly.com/isaacpopoola/15min" style={{minWidth:'320px', height:'630px'}}></div>
                        <script type="text/javascript" src="https://assets.calendly.com/assets/external/widget.js"></script>
                    {/* <!-- Calendly inline widget end --> */}
                </Card>
            </div>
        )
    }

}

export default RecruiterCard;
